import React from "react";

const AddVideoToReel = (props) => {
  const selectedVideo = null;

  const addToReelHandler = () => {
    props.onAddToReel(selectedVideo);
  };
  return (
    <div>
      <select value={selectedVideo}>
        {props.videos.map((video) => {
          return <option value={video.id}>{video.name}</option>;
        })}
      </select>
      <button type="button" onClick={addToReelHandler}>
        Add to Reel
      </button>
    </div>
  );
};

export default AddVideoToReel;
